import PumpDetail from './PumpDetail'; // Import the PumpDetail component

const App = () => {
    return (
        <Router>
            <Switch>
                <Route path="/" exact component={Homeage} />
                <Route path="/pump/:id" component={PumpDetail} /> {/* Dynamic route for pump details */}
                {/* Add more routes as needed */}
            </Switch>
        </Router>
    );
};

export default App;
